import React, { useEffect, useState } from "react";

import { useDispatch, useSelector } from "react-redux";
import { getAllRéalisations } from "../redux/NosRéalisations/actionsRéalisations";

const RéalisationSection = () => {
    //get All réalisations
  const réalisation = useSelector((state) => state.réalisationStore.réalisation);
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getAllRéalisations());
  }, []);
  return (
    <div>
      <div className="service" id="service">
        <div className="container">
          <div className="section-header text-center  " data-wow-delay="0.1s">
            <p> Nos</p>
            <h2>Réalisation</h2>
          </div>
          <div className="row d-flex justify-content-lg-around ">
            {réalisation.map((el) => (
              <div className="col-lg-4  justify-con ">
                <div className="service-item">
                  <div className="service-icon">

<h3> {el.title}</h3>
                  </div>
                  <div className="service-text">

                   </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default RéalisationSection;
